import React from "react";
import { useAuth0 } from "@auth0/auth0-react";
import { Link } from "react-router-dom";
import "./navbar.css"; // Referencia al archivo CSS del componente

const Navbar = () => {
  const { isAuthenticated, loginWithRedirect, logout, user } = useAuth0();

  return (
    <header className="navbar">
      <div className="navbar-container">
        {/* Logo */}
        <div className="navbar-logo">
          <Link to="/">
            <img src="./logo.png" alt="Taste Buddy Logo" />
            <span>Taste Buddy</span>
          </Link>
        </div>

        {/* Search Bar */}
        <div className="navbar-search">
          <select className="navbar-categories">
            <option>All Categories</option>
            <option>Recipes</option>
            <option>Restaurants</option>
            <option>Services</option>
          </select>
          <input type="text" placeholder="Search" className="navbar-input" />
          <button className="navbar-search-btn">Q</button>
        </div>

        {/* User Actions */}
        <div className="navbar-actions">
          {/* Profile Section */}
          {isAuthenticated ? (
            <div className="navbar-profile">
              <img src={user.picture} alt={user.name} className="profile-img" />
              <span>{user.name}</span>
              <button
                onClick={() => logout({ returnTo: window.location.origin })}
                className="logout-btn"
              >
                Log Out
              </button>
            </div>
          ) : (
            <button onClick={() => loginWithRedirect()} className="login-btn">
              Sign Up
            </button>
          )}

          {/* Wishlist */}
          <button className="navbar-wishlist">
            <span>&hearts;</span>
          </button>

          {/* Cart */}
          <div className="navbar-cart">
            <button>
              <span>Cart: 12</span>
            </button>
          </div>
        </div>
      </div>

      {/* Navigation Links */}
      <nav className="navbar-links">
        <Link to="/">Home</Link>
        <Link to="/recipes">Recipes</Link>
        <Link to="/services">Service</Link>
        <Link to="/restaurants">Restaurants</Link>
      </nav>
    </header>
  );
};

export default Navbar;
